def D_BASE64(Str):
    if(len(Str)%4==1):
        Str+="==="
    elif(len(Str)%4==2):
        Str+="=="
    elif(len(Str)%4==3):
        Str+="="
    return Str
def string2image(img_str):
    img_str=D_BASE64(img_str)
    print(img_str)
    img_str = base64.b64decode(img_str)
    img_arr = nps.frombuffer(img_str, nps.uint8)
    img = cv2.imdecode(img_arr, cv2.IMREAD_COLOR)
    return img
